{'sdk_element_id': 'BT-750-Lot', 'sdk_element_title': 'Selection Criteria Description', 'sdk_element_xpath': "/*/cac:ProcurementProjectLot[cbc:ID/@schemeName='Lot']/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description", 'test_data_xpaths': [{'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e6759', 'test_data_id': 'cn_23', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'NOT AVAILABLE'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675b', 'test_data_id': 'cn-social_24', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Qualification Stage (Pass/Fail):
									Assessment of suitability and selection of Bidders response via ESPD (Scotland).'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'As stated in the procurement documents.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'As stated in the procurement documents.'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675c', 'test_data_id': 'cn_24_open', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Bidders will be required to state if any of the exclusion grounds as detailed within Regulation 58 (1) of The Public Contracts (Scotland) Regulations 2015 apply to them.  If required by the member state, bidders are required to be enrolled in the relevant professional or trade registers within the country in which they are established (in the United Kingdom, the bidder is a company registered with the Registrar of Companies and can provide a certificate stating that he is certified as incorporated or registered or, where he is not so certified, a certificate stating that the person concerned has declared on oath that he is engaged in the profession in a specific place under a given business name).  Bidders will be required to state if it is a requirement in the bidders country of establishment to hold a particular authorisation or membership of a particular organisation in order to be able to perform the service in question. Where it is required, within a bidders country of establishment they must confirm which authorisation or memberships of the relevant organisation(s) are required in order to perform this service and also must confirm if they hold the particular authorisation or memberships.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Bidders will be required to have a minimum general yearly turnover of GBP 200 000.00 for the last 3 years. Where turnover information is not available for the time period requested, the bidder will be required to state the date which they were set up/started trading. Where a bidder fails to meet the minimum financial turnover requirements in its own right but is a subsidiary of a group, the bidder must state if they are relying on a parent company guarantee (the parent company must meet the stipulated minimum financial requirements). The parent company guarantee will be in the form provided in the tender documentation (Appendix A1). Where a bidder is applying as part of a consortium the collective annual turnover of all consortium members will be utilised in the overall assessment of annual turnover. Bidders will require to evidence the equivalent of a Dun and Bradstreet Failure Score of 20 or above. If a bidder considers that the D&B failure score does not reflect their current financial status, the bidder should give a detailed explanation and will be required to provide any relevant supporting independent evidence at request for documentation stage. Where the bidder is a subsidiary of a group but is applying as a separate legal entity and fails to meet the minimum D&B Failure Score (or equivalent) as a company, a parent company guarantee will be required. The parent company must meet the minimum financial requirements as assessed by the Council. The parent company guarantee will be in the form provided in the tender documentation (Appendix A1). Where a bidder is under no obligation to publish accounts and therefore does not have a D&B failure score, they will be required to provide their audited financial accounts for the previous 2 years as part of the request for documentation stage in order that the Council may assess these to determine the suitability of the bidder to undertake a contract of this size. Where a consortium bid is received, the D&B failure score of each consortium member shall be assessed. Bidders must hold or can commit to obtain prior to the commence of any subsequently awarded contract, the types and levels of insurance indicated below: Employers (compulsory) liability insurance  minimum GBP 10 million each and every claim. Public and product liability insurance  minimum GBP 10 million each and every claim but in the aggregate for products. Statutory third party motor vehicle insurance.  Minimum level(s) of standards possibly required:   Minimum general yearly turnover of GBP 200 000.00 for the last 3 years. Minimum Dun and Bradstreet Failure Score of 20 or equivalent credit rating. Employers (compulsory) liability insurance with a minimum indemnity limit of GBP 10 million each and every claim. Public and Product Liability Insurance with a minimum indemnity limit of GBP 10 million each and every claim but in the aggregate for products. Statutory third party motor vehicle insurance.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "Bidders will be required to provide examples that demonstrate that they have the relevant experience to deliver the works/services required under this contract. Bidders will require to confirm that the personnel to be used in the execution of this contract possess the City and Guilds Level 3 Certificate for in-service inspections and testing of electrical equipment or other equivalent qualification relevant to the country where the bidders registered office or place of business is based. Bidders will be required to confirm their average annual manpower for the last 3 years and the number of managerial staff for the last 3 years. Bidders will be required to demonstrate that they have (or have access to) the relevant tools, plant or technical equipment to deliver the works/services required under this contract. Bidders will be required to confirm whether they intend to subcontract and, if so, for what proportion of the contract (where the bidder intends to subcontract more than 25 % of any contract value to a single subcontractor, a financial report will be carried out on the subcontractor. The Council reserve the right to request one copy of all subcontractors last 2 years audited accounts and details of significant changes since the last year end. The Council also reserve the right to reject the use of subcontractors in relation to the contract, where they fail to meet the Council's minimum financial criteria). Bidders must have health and safety accreditation to BS OHSAS 18001 (or equivalent) or have a documented policy for health and safety management, endorsed by the Chief Executive Officer or equivalent. Bidders must have quality management accreditation to BS EN ISO 9001 (or equivalent) or have a documented policy for quality management, endorsed by the Chief Executive Officer or equivalent. Bidders must have environmental management accreditation to BS EN ISO 14001 (or equivalent) or have a documented policy for environmental management, endorsed by the Chief Executive Officer or equivalent.  Minimum level(s) of standards possibly required:   Bidders must have previous relevant experience. Bidders personnel must have City and Guilds Level 3 certificate for in-service inspections and testing of electrical equipment or other equivalent qualification. Bidders must have the appropriate number of employees to successfully deliver this contract. Bidders must have the appropriate tools, plant and equipment to successfully deliver this contract. Bidders must state if they intend to subcontract any portion of this contract. Bidders must be accredited to BS OHSAS 18001 (or equivalent) or have a documented policy for health and safety management. Bidders must be accredited to BS EN ISO 9001 (or equivalent) or have a documented policy for quality management. Bidders must be accredited to BS EN ISO 14001 (or equivalent) or have a documented policy for environmental management"}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675d', 'test_data_id': 'cn_81_FRA', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': '
									Les entreprises candidates doivent fournir  lappui de leur candidature un dossier de prsentation du candidat, et le cas chant de chaque co-traitant, comprenant entre autres:
									 les caractristiques de lentreprise: statuts, forme juridique, composition du capital, principaux actionnaires, participations, reprsentants engageant lentreprise, effectif total, dimensions, activits, organigramme;
									 un extrait k-bis ou quivalent;
									 une attestation dassurance en cours de validit pour le candidat et chaque cotraitant;
									 le chiffre daffaire global et le CA concernant les fournitures, services ou travaux objet du march, raliss au cours des trois derniers exercices disponibles, ainsi que le nombre total de salaris de lentreprise candidate;
									 les trois derniers bilans et comptes de rsultat des oprateurs conomiques pour lesquels ltablissement des bilans est obligatoire en vertu de la loi.
									Lorsquil appartient  un groupe, une attestation certifiant de son autonomie commerciale et de sa situation de concurrence vis--vis des autres entreprises du groupe.
									Si le candidat recourt  la sous-traitance, il doit produire les mmes renseignements et documents concernant son/ses sous-traitants. En outre, pour justifier quil dispose des capacits de ce(s) sous-traitant(s) pour lexcution du march, il apporte la preuve par tout moyen appropri.
									La sous-traitance totale est interdite.
								'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "
									La slection des candidats se fera sur les critres techniques suivants:
									 matrise de lassistance  matrise duvre en suivi de ralisation dinstallations tertiaires;
									 moyens matriels/logiciels et mthodologiques disponibles et matriss pour le march dans les mtiers/domaines techniques cits au III.2.3.2).
									Latteinte de ces critres sera dmontre par les dossiers lists ci-aprs. Chaque entreprise candidate (le mandataire et chacun des cotraitants dans le cadre dun groupement) devra prsenter:
									1) Un dossier prcis et dtaill de rfrences en assistance  MOE en suivi de ralisation dinstallations tertiaires de mme complexit excute dans les cinq dernires annes et prcisant:
									1.1) Les caractristiques des installations et des procds techniques quelles intgrent;
									1.2) En cas de groupement, les tches excutes en propre par lentreprise.
									Devront notamment tre prciss: la nature du projet, la date, le lieu dexcution, les rfrences du client correspondant avec ses coordonnes postales et tlphoniques ainsi que celles de la personne en charge du projet, un descriptif prcis des responsabilits exerces et des actions conduites par le candidat dans le projet;
									2) Ressources et comptences disponibles pour le march, sur sa dure, dans les mtiers/domaines techniques suivants:
									2.1) Terrassement;
									2.2) VRD;
									2.3) Construction tous corps d'tat;
									2.4) Gnie civil;
									2.5) Ventilation;
									2.6) Fluides industriel;
									2.7) Construction mcanique;
									2.8) lectricit courants forts;
									2.9) lectricit courants faibles et de scurit;
									2.10) Protection physique;
									2.11) Cltures;
									2.12) Management projet, organisation et gestion des ressources associes;
									2.13) OPC;
									2.14) Ingnierie systme  planification, matrise du logiciel MS project, version 2010 ou suprieure, ncessaire pour llaboration et le suivi de la planification de ralisation;
									2.15) Ingnierie systme  synthse, matrise du logiciel REVIT, version 2017 ou suprieure, ncessaire pour la mise  jour et lexploitation dune maquette numrique 3D;
									2.16) Matrise du logiciel AutocAD, version 2016 ou suprieure, ncessaire pour la vrification, la cration et la mise  jour de plans techniques.
									Si le candidat recourt  la sous-traitance, il doit produire les mmes renseignements et documents concernant ce sous-traitant. En outre, pour justifier quil dispose des capacits de ce(s) sous-traitant(s) pour lexcution du march, il apporte la preuve par tout moyen appropri.
								"}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': "
									Le CEA procdera  l'analyse et  la slection des candidatures conformment aux critres suivants:
									 conformit administrative;
									 capacit financire;
									 capacit technique [dtaill en III.2.3)].
									1) Prsentation des candidatures:
									Les entreprises candidates doivent fournir  lappui de leur candidature:
									 le formulaire DC1 (lettre de candidature et dsignation du mandataire par ses cotraitants) ou quivalent;
									 le formulaire DC2 (dclaration du candidat individuel ou du membre du groupement), ou quivalent.
									Les formulaires sont disponibles sur le site internet du ministre de l'conomie, de l'industrie et de l'emploi:
									http://www.economie.gouv.fr/daj/formulairesdeclaration-du-candidat
									 la copie du ou des jugements prononcs s'il est en redressement judiciaire ou dans une procdure trangre quivalente;
									 les attestations de rgularit fiscales et sociales.
									Il est interdit de cumuler les candidatures:
									 en tant que candidat individuel et membre dun ou plusieurs groupements y compris en tant que mandataire;
									 en tant que membre dun groupement et mandataire dun autre.
									2) Les entreprises nouvellement cres sont autorises  prsenter leur candidature. Si elles ne sont pas en mesure de produire certains des documents demands dans le prsent avis de march, elles peuvent justifier de leurs capacits financires et professionnelles par dautres moyens que ceux indiqus dans le prsent avis et notamment par la prsentation de titres ou de lexprience professionnelle du ou de leurs responsables.
									Le recours  la sous-traitance sera effectu dans le cadre des dispositions du code de la commande publique et des dispositions applicables aux marchs publics de dfense ou de scurit. 
									Le formulaire DC4 est  complter pour chaque demande dacceptation de sous-traitant.
								"}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675e', 'test_data_id': 'cn_24_open_accel', 'xpaths': [{'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Sono ammessi tutti gli operatori economici previsti dallart. 45 del D.Lgs. n. 50/2016, compresi i concorrenti appositamente e temporaneamente raggruppati ai sensi dellart. 45, comma 2, lett. d) del D.Lgs. n. 50/2016 e aggregazioni tra imprese aderenti al contratto di rete ai sensi dellart. 45, comma 2, lett. f) del D.Lgs. n. 50/2016, secondo le modalit indicate nel disciplinare di gara.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Ciascuna impresa concorrente (anche se ausiliaria, consorziata, mandante o retista) dovr produrre due idonee dichiarazioni bancarie.'}, {'xpath': 'ContractNotice/cac:ProcurementProjectLot/cac:TenderingTerms/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:SelectionCriteria/cbc:Description', 'value': 'Sono ammesse a partecipare le imprese e/o raggruppamenti e/o reti specializzati nella produzione dei manufatti per cui chiedono di concorrere. A tal fine, ciascun concorrente dovr dichiarare/dimostrare il possesso dei seguenti requisiti minimi: a) fasi di lavorazione essenziali che ogni operatore economico partecipante dovr possedere (esclusi rete, sedia e cassetta porta pistola e gli accessori come viti, maniglie e guide):  taglio, fresatura, foratura, piallatura, levigatura e incollaggio del legno,  assemblaggio delle parti componenti i singoli arredi,  imballaggio,  montaggio a destinazione; b) organizzazione complessiva dimpresa desumibile da:  elenco descrittivo delle attrezzature tecniche possedute afferenti la lavorazione completi dei manufatti in legno,  stabilimenti di produzione e forza lavoro,  capacit produttiva giornaliera riferita a prodotti finiti analoghi a quelli dellappalto in linea con i termini di approntamento e montaggio degli arredi in fornitura (55 giorni); c) certificazione di qualit in corso di validit, attestante lottemperanza alle norme UNI EN ISO 9001-2015, rilasciata da ente accreditato Accredia o altro ente in mutuo riconoscimento, relativa al settore di accreditamento (EA) e processi verificati e certificati (indicati nello scopo o campo di applicazione) concernenti la/e fase/i di lavorazione svolta/e dalloperatore economico per la tipologia di manufatti per i quali chiede di partecipare; d) fatturato specifico: le ditte partecipanti dovranno presentare lelenco dettagliato di forniture, realizzate nel triennio 2017-2019, relativo a prodotti finiti analoghi per materia prima utilizzata (manufatti in legno) a quelli per cui si chiede di partecipare, la cui media annua deve essere pari ad almeno il valore della gara (291 934,60 EUR, IVA esclusa). Lelenco deve contenere lindicazione dettagliata di tipologia dei prodotti, importi fatturati, date dei contratti e beneficiari. Lamministrazione si riserva la facolt di disporre sopralluoghi tecnici presso le sedi, anche secondarie, dei concorrenti, per verificarne la capacit tecnica. Le relative spese sono a carico del concorrente. I livelli minimi di capacit tecnica ed economica sono giustificati dalloggettiva complessit della fornitura (quanto a tempi di approntamento e consegna dei prodotti finiti, specie per richiesta di V durgenza o V dobbligo), in quanto i materiali dovranno essere adattati allambiente dove dovranno essere consegnati ed installati.'}]}, {'test_data_suite_oid': '66c33572f5c94357640e6758', 'test_data_suite_id': 'sdk_examples_cn', 'test_data_oid': '66c33572f5c94357640e675f', 'test_data_id': 'cn_24_multilingual', 'xpaths': [{'xpath': 